import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for search input and focus on it
    await page.waitForSelector('#searchInput', { timeout: 5000 });
    await page.click('#searchInput');

    // Type search query to trigger autocomplete
    await page.type('#searchInput', 'iPhone');

    // Wait for autocomplete suggestions to appear
    await page.waitForSelector('.search-suggestions', { timeout: 5000 });

    // Take screenshot of autocomplete suggestions
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_autocomplete.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_autocomplete.png'));

    // Extract suggestion items
    const suggestions = await page.$$eval('.suggestion-item', items => 
      items.map(item => item.textContent.trim())
    );

    // Verify autocomplete contains relevant suggestions
    const hasIphoneSuggestions = suggestions.some(suggestion => 
      suggestion.toLowerCase().includes('iphone')
    );

    if (!hasIphoneSuggestions) {
      throw new Error('Autocomplete did not show iPhone-related suggestions');
    }

    return {
      success: true,
      action: "Tested search autocomplete functionality with 'iPhone' query",
      extractedData: {
        suggestions: suggestions,
        suggestionCount: suggestions.length,
        hasIphoneSuggestions: hasIphoneSuggestions
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to test search autocomplete functionality",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
